CREATE SCHEMA IF NOT EXISTS linklist;

CREATE TABLE IF NOT EXISTS category_entity(
        id SERIAL PRIMARY KEY,
        title varchar(255)
);

CREATE TABLE IF NOT EXISTS link_entity(
        id SERIAL PRIMARY KEY,
        category bigint,
        title varchar(255),
        url varchar(1024),
        description varchar(1024),
        image varchar(129472),
        support boolean,
	    contact varchar(255),
        likes integer,
        dislikes integer,
        active boolean,
        FOREIGN KEY (category) REFERENCES category_entity(id)
);



